import React from 'react';
import './Advisor.css';
import lineImage from './images/testimonialimg.png';

function Advisor() {
  return (
    <>
      <div className='advisor-section'>
        <div className='image-wrapper'>
          <img src={lineImage} className='advisor-line' alt='advisor-line' />
        </div>
        <div className='advisor-container'>
          <div className='quote-wrapper'>
            <h1 className='quoted-text'>
              zara rarhim is a strategic advisor to
              <br />
              business leaders, startups, artists,
              <br />
              musicians, brands, media entities, meme- lords, comedians,
              <br />
              accidental villans, heroes, and friends.
            </h1>
          </div>
        </div>
      </div>
    </>
  );
}

export default Advisor;
